Statements define types, classes, instance clauses, and derive clauses. statement -> typedef | classdef | instanceclause | deriveclause Type definitions Types may be either sum types, product types, record types, or opaque types. typedef -> prodtypedef | sumtypedef | recordtypedef | opaquetypedef Product type definition A product type definition defines a new product type. prodtypedef -> 'prod' typename { varname } '=' prod
prod -> { typeexp }
typeexp -> varname | longtypename | '(' prod ')' Product type definitions instruct the code generator to generate a product type for the target language. Sum type definition A sum type definition defines a new sum type. sumtypedef -> 'sum' typename { varname } '=' sum
sum -> sumconstructor { '|' sumconstructor }
sumconstructor -> typename prod Sum type definitions instruct the code generator to generate a sum type for the target language. Record type definition A record type definition defines a new record type. recordtypedef -> 'record' typename { varname } '=' record
record -> '{' [ field { ',' field } ] '}'
field -> fieldname ':' prod Record type definitions instruct the code generator to generate a record type for the target language. Opaque type definition An opaque type definition defines a new opaque type. opaquetypedef -> 'opaque' typename { varname } Opaque type definitions must map to existing types in the target language and it's up to the Codegen module to determine how that's exactly done. Class definition A class definition introduces a new class. classdef -> 'class' [ constraintexps '<=' ] classname { varname }
constraintexp -> classref { varname } | '(' constraintexps ')'
constraintexps -> [ constraintexp { ',' constraintexp } ] Class definitions communicate with the code generator the implementations that already exist (via instance clauses) or that one would like to generate (via derive clauses). Instance clause An instance clause specifies a type is an instance of a class. instanceclause -> 'instance' constraint [ ':-' constraintexps ]
constraint -> classref { typeexp } Instance clauses do not instruct the code generator to generate code, but instead instructs the compiler (semantic checking) that the target language environment provides type class implementations for the given type (provided that the given constraintexps also have implementations). Derive clause Derive clauses instruct the code generator to generate code for a type so that it is an instance of a class. deriveclause -> 'derive' constraint Note the code generation of a type for a class is implemented via builtin derivation rules (which developers may extend).
